fullnameOverride: "web-gateway"

namespace:

tls:
  bucketeerJP:
    secret:
    cert:
    key:
  service:
    secret:
    cert:
    key:

envoy:
  image:
    repository: envoyproxy/envoy-alpine
    tag: v1.21.1
    pullPolicy: IfNotPresent
  serviceCluster: bucketeer
  adminPort: 8001
  accountDescriptor: ""
  auditlogDescriptor: ""
  authDescriptor: ""
  autoopsDescriptor: ""
  environmentDescriptor: ""
  eventcounterDescriptor: ""
  experimentDescriptor: ""
  featureDescriptor: ""
  migrationDescriptor: ""
  notificationDescriptor: ""
  pushDescriptor: ""
  userDescriptor: ""
  config:

service:
  type: LoadBalancer
  loadBalancerIP:
  port: 443

health:
  initialDelaySeconds: 10
  periodSeconds: 10
  failureThreshold: 10

resources: {}

affinity: {}

nodeSelector: {}

pdb:
  enabled:
  maxUnavailable: 50%

hpa:
  enabled:
  minReplicas:
  maxReplicas:
  metrics:
    cpu:
      targetAverageUtilization:

tolerations: []
